import React from 'react'
import { useNavigate } from 'react-router-dom'
import './Header.css';
import Swal from 'sweetalert2';
import { useDispatch, useSelector } from 'react-redux';
import { changeImage } from '../../../Redux/userimageReducer';


function Header() {

    const navigate = useNavigate();
    const dispatch=useDispatch();
    const handleLogoutUser = (e) => {
        e.preventDefault();
        Swal.fire({
            title: 'Logout?',
            text: "Do you want to Logout?",
            icon: 'warning',
            showCancelButton: true,
            confirmButtonColor: '#3085d6',
            cancelButtonColor: '#d33',
            confirmButtonText: 'Logout'
        }).then((result) => {
            if (result.isConfirmed) {
                localStorage.clear();
                dispatch({ type: 'logout' })
                navigate('/')
            }
        })
    }

    const userImage = useSelector((state) => {
        return state.userImage;

    })

    return (
        <nav class="navbar navbar-expand-lg  " style={{background:'#1e519b'}}>
            <div class="container-fluid">

                <a class="navbar-brand" href="/home" style={{color:'wheat'}}>
                   Welcome
                </a>
                <div class="collapse navbar-collapse" id="navbarSupportedContent">
                    <ul class="navbar-nav me-auto mb-2 mb-lg-0">
                        <li class="nav-item">
                            <a class="nav-link active" aria-current="page" href="/Profile" style={{color:'white'}}>Profile</a>
                        </li>
                    </ul>
                    <form class="d-flex">
                        <span className='navUserName'>"Adharsh"</span>
                        <button className='userLogout' onClick={handleLogoutUser} type="submit">logout</button>
                    </form>
                </div>
            </div>
        </nav>
    )
}

export default Header
